import React from 'react';

function DiagnosisResult({ result }) {
  return result ? (
    <div>
      <img src={`data:image/jpeg;base64,${result.base64}`} style={{ width: '300px' }} alt="resultado" />
      <ul>
        {result.detections.map((d, i) => (
          <li key={i}>{d.class} ({d.confidence})</li>
        ))}
      </ul>
    </div>
  ) : null;
}

export default DiagnosisResult;
